import React from 'react'
import { useState,useEffect } from 'react';
import axios from 'axios';
import Navbar from '../../navbar/Navbar';
import { Link } from 'react-router-dom';
import "./villages.scss"

//Mapping Images
import narutoMap from "../../villagesMapping/narutoMap.png"
//Villages
import rainVillage from "../../villagesMapping/Amegakure_Symbol.png"
//Include Map, War Lore, Politics, Kage

const Villages = () => {

    const [villages,setVillages] = useState([]);

    const tB = "tailed-beasts";

    useEffect(() =>{
        const fetchAllVillages = async () =>{
        try {
            const res = await axios.get("https://dattebayo-api.onrender.com/villages");
            setVillages(res.data.villages)
            console.log(res.data.villages);
        } catch (error) {
            console.error(error);
        }
        }
        fetchAllVillages();
    },[])

  return (
    <div className="villagePage">
        <div className="navbar"><Navbar/></div>
        <div className="header">
            <h1>Villages</h1>

        </div>

        <div className="villagesWrapper">

            {villages.map(village=>(
                <div className="villageItem" key={village.id}>

                    <div className="villageName">{village.name}</div> 
                    {(() => {
                            switch (village.id) {
                            case 0:
                                return <img src={boilReleaseImage} />;
                            case 1:
                                return <img src={byakuganImage} />;
                            case 2:
                                return <img src={crystalReleaseImage} />;
                            case 3:
                                return <img src={darkReleaseImage} />;
                            case 4:
                                return <img src={mangekyoImage} />;
                            case 5:
                                return <img src={explosionReleaseImage} />;
                            case 6:
                                return <img src={iburiClanKekkiImage} />;
                            case 7:
                                return <img src={iceReleaseImage} />;
                            case 8:
                                return <img src={isshikiDojutsuImage} />;
                            case 9:
                                return <img src={byakuganImage} />;
                            case 10:
                                return <img src={joganImage} />;
                            case 11:
                                return <img src={jugoClanImage} />;
                            case 12:
                                return <img src={ketsuryuganImage} />;
                            case 13:
                                return <img src={kuramaClanImage} />;
                            case 14:
                                return <img src={lavaReleaseImage} />;
                            case 15:
                                return <img src={byakuganImage} />;
                            case 16:
                                return <img src={byakuganImage} />;
                            case 17:
                                return <img src={magnetReleaseImage} />;
                            case 18:
                                return <img src={byakuganImage} />;
                            case 19:
                                return <img src={mangekyoImage} />;
                            default:

                                return null;
                            }
                        })()}




                </div>
            ))}
        </div>
        <div className="worldMap">
            <img src={narutoMap} alt="" />
        </div>
    </div>
  )
}

export default Villages
